import { Box, Paper, Skeleton, Typography } from "@mui/material";
import {useJsApiLoader, GoogleMap} from '@react-google-maps/api'

export default function AboutPage() {

 const {isLoaded, GoogleMap} = useJsApiLoader({
    googleMapsApiKey:'AIzaSyAoXG3DelXQY0v8VfyCwpS5_Y1AcGcIKzk'
})
if(!isLoaded){
    <h4>Loading.....</h4>
}
    return (
        <Box sx={{
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'center',
            marginTop: 2,
            textAlign:'justify'
        }} component={Paper}>
            <Typography variant="h4" padding={2}>
                Welcome to cool collections by Harpreet Singh. I am
                a Student at Manukau Institute of technology, Manukau, Auckland.
                This is a Student Project and Everything on this website is a demo.
                Note: please do enter your real details on any form of this website. 
            </Typography>

        </Box>

    )
}
